// src/components/MainPage.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import NavBar from './NavBar';

import buffet from './img/buffet.jpg';
import laptop from './img/laptop.jpg';
import diet from './img/diet.jpg';
import steak from './img/steak.jpg';
import emptyPlate from './img/empty_plate.jpg';
import { toast } from 'react-toastify'; // ‚úÖ ÏïåÎ¶ºÏö© ÎùºÏù¥Î∏åÎü¨Î¶¨
const BASE_URL = process.env.REACT_APP_BASE_URL;


import './css/main.css';

export default function MainPage() {
  const [userInfo, setUserInfo] = useState(null);
  const navigate = useNavigate();

  // ‚úÖ 2. Ìï≠ÏÉÅ ÏµúÏã† ÏÑ∏ÏÖò ÎèôÍ∏∞Ìôî
  useEffect(() => {
    axios.get(`${BASE_URL}/users/ses`, { withCredentials: true })
        .then((res) => {
            if (res.data) {
                console.log("‚úÖ ÏÑ∏ÏÖò ÎèôÍ∏∞Ìôî ÏôÑÎ£å:", res.data);
                setUserInfo(res.data);
                localStorage.setItem('user', JSON.stringify(res.data));
            }
        })
        .catch(() => {
            console.log('‚ùå ÏÑ∏ÏÖò ÏóÜÏùå');
            localStorage.removeItem('user');
            setUserInfo(null);
        });
  }, []);

// üß™ userInfo Î≥ÄÍ≤Ω Î°úÍ∑∏
useEffect(() => {
    console.log('üåÄ userInfo Î≥ÄÍ≤Ω:', userInfo);
}, [userInfo]);

  const handleProtectedNavigate = (path, businessOnly = false) => {
    if (!userInfo) {
      toast.warning("Î°úÍ∑∏Ïù∏Ïù¥ ÌïÑÏöîÌï©ÎãàÎã§.");
      return;
    }
  
    if (businessOnly && userInfo.grade !== 'business') {
      toast.warning("Ìï¥Îãπ Í∏∞Îä•ÏùÄ ÎπÑÏ¶àÎãàÏä§ Îì±Í∏âÎßå Ïù¥Ïö© Í∞ÄÎä•Ìï©ÎãàÎã§.");
      return;
    }
  
    navigate(path);
  };

  return (
    <>
      <NavBar />
      <div className="mainpage-wrapper">
        {/* Î©îÏù∏ Î∞∞ÎÑà */}
        <div className="hero-image-wrapper">
          <img className="responsive-img hero-img-horizontal" src={buffet} alt="Î∑îÌéò Ïù¥ÎØ∏ÏßÄ" />
          <div className="main-text over-hero">
            <h1>Ïò§Îäò, <span>Í±¥Í∞ïÌïòÍ≤å</span> Î®πÏñ¥Î≥ºÍπåÏöî?</h1>
            <p>AIÍ∞Ä Ï∂îÏ≤úÌï¥Ï£ºÎäî ÎÇòÎßåÏùò ÏãùÎã®ÏùÑ Î∞õÏïÑÎ≥¥ÏÑ∏Ïöî üç±</p>
            <button onClick={() => handleProtectedNavigate('/meal-recommend', true)}>ÏãùÎã® Ï∂îÏ≤ú Î∞õÍ∏∞ ‚Üí</button>
          </div>
        </div>

        {/* Ïπ¥Îìú Í∑∏Î¶¨Îìú ÏÜåÍ∞ú */}
        <section className="card-section">
          <div className="card-grid">

            {/* ÏùåÏãù Ïù¥ÎØ∏ÏßÄ Î∂ÑÏÑù Ïπ¥Îìú */}
            <div className="card">
              <img src={diet} alt="ÏãùÎã® Í¥ÄÎ¶¨" className="card-img" />
              <div className="card-content">
                <h3>ÏùåÏãù Ïù¥ÎØ∏ÏßÄ Î∂ÑÏÑù</h3>
                <p>ÏãùÏÇ¨ ÏÇ¨ÏßÑÏùÑ ÏóÖÎ°úÎìúÌïòÎ©¥<br />ÏûêÎèôÏúºÎ°ú ÏòÅÏñë Ï†ïÎ≥¥ÍπåÏßÄ ÌôïÏù∏ Í∞ÄÎä•!</p>
                <button onClick={() => handleProtectedNavigate('/image-analysis')}>Î∂ÑÏÑùÌïòÍ∏∞</button>
              </div>
            </div>

            {/* Í±¥Í∞ï ÏÉÅÎã¥ Ï±óÎ¥á Ïπ¥Îìú */}
            <div className="card">
              <img src={laptop} alt="Ï∂îÏ≤ú ÏãùÎãπ" className="card-img" />
              <div className="card-content">
                <h3>Í±¥Í∞ï ÏÉÅÎã¥ Ï±óÎ¥á</h3>
                <p>ÏÇ¨Ïö©Ïûê Ï†ïÎ≥¥ Í∏∞Î∞òÏúºÎ°ú<br />Í∞úÏù∏ÌôîÎêú Í±¥Í∞ï ÏÉÅÎã¥ÏùÑ Î∞õÏïÑÎ≥¥ÏÑ∏Ïöî.</p>
                <button onClick={() => handleProtectedNavigate('/chatbot')}>ÏÉÅÎã¥ÌïòÍ∏∞</button>
              </div>
            </div>

            {/* AI ÏãùÎã® Ï∂îÏ≤ú Ïπ¥Îìú */}
            <div className="card">
              <img src={emptyPlate} alt="ÏòÅÏñë Î∂ÑÏÑù" className="card-img" />
              <div className="card-content">
                <h3>AI ÏãùÎã® Ï°∞Ìöå</h3>
                <p>AIÍ∞Ä ÎãπÏã†Ïùò ÏãùÎã® Ï†ïÎ≥¥Ïóê ÎßûÏ∂∞<br />ÏãúÍ∞ÅÌôî Ìï¥Ï§çÎãàÎã§.</p>
                <button onClick={() => handleProtectedNavigate('/meal-plan', true)}>ÏãùÎã® Ï°∞Ìöå ÌïòÍ∏∞</button>
              </div>
            </div>

          </div>
        </section>
      </div>
    </>
  );
}
